 */

import { createMuiTheme } from '@material-ui/core/styles';
import yellow from '@material-ui/core/colors/yellow';

export const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#0f0430',
      dark: '#080218',
      contrastText: '#d4af37',
    },
    secondary: {
      main: '#d4af37',
      contrastText: '#0f0430',
    },
    background: {
      default: "#0f0430"
    },
  },
  overrides: {
    MuiStepLabel: {
      color: '#080218',
        label: {
            color: '#080218',
            '&$active': {
                color: '#d4af37',
            },
            '&$completed': {
              color: '#d4af37',
          },
        },
    },
},
});
